    this.props.dispatch({
      type: config.TITLE_CHANGED,
      title: "Recognition"
    })
}

  render() {
    return <div>RECOGNITION PAGE</div>;
  }

}

const mapStateToProps = (state) => {
  return { }
}

export default connect(mapStateToProps)(RecognitionPage);
